import HomeHeader from "../components/HomeHeader";
import HomeProjectCard from "../components/HomeProjectCard";

const HomeScreen = () => {
  return (
    <>
      <HomeHeader />
      <div className="container">
        <div className="row">
          <HomeProjectCard />
          <HomeProjectCard />
          <HomeProjectCard />
        </div>
      </div>
    </>
  );
};

export default HomeScreen;
